subSubSection.paragraph:
Male terminalia.
Apex of ventral median lobe strongly pointed and apex of dorsal lobe rounded or broadly projected; ventral lobe shorter than dorsal lobe; spined region of internal sac not clearly divided, with dense long simple spines (
Fig. 90a
). Eighth sternite obliquely truncate or even rounded at sides, very shallowly emarginate at apex, with sparse long and short setae arising terminally; ventral surface with sparse cloud-like processes (
Fig. 90b
). Eighth tergite slightly point at apex, with fairly dense basally-forked spines and simple spines on ventral surface (
Fig. 90c
). Paramere long, 2.0–2.09 × as long as wide, gradually tapering toward apex; apex with sparse to dense long and short setae (
Fig. 90d
).

Ovipositor and spermatheca.
Ovipositor relatively long; styli long, arising almost terminally with short hairs (
Fig. 90e
). Spermatheca slightly curved; spermathecal gland arising near base (
Fig. 90f
).

